window.bookSummaryJSON = "<p><b>A hilarious, heart-tugging rom com about two people finding each other again one phone call at a time.</b></p> <p>Hannah Gold never thought she’d speak to Ethan Reisner ever again. Getting dumped in high school will do that to you. But when she needs to find a beloved sweater in time for her parents’ 50th anniversary, she begins her search where she last saw it: Ethan’s childhood home.</p> <p>She thought calling Ethan out of the blue would be the hardest part, but breaking fifteen years of silence was just the beginning. Why is Ethan being so friendly? And helpful? And funny? And is it possible for someone to be handsome over the phone?</p> <p>As her feelings take her to unexpected places and her parents’ anniversary looms closer, Hannah will have to dig deep, find out what’s real, and decide exactly what she wants.</p>"; 
